import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      {/* Navbar */}
      <div className="navbar">
        <div className="logo"></div>
        <ul>
          <li>What I Do</li>
          <li>Projetcs</li>
          <li>About Me</li>
        </ul>
      </div>

      {/* Landing Page */}
      <div className="landingPage">
        <div className="user-first-shadow">User First</div>
        <div className="slogan">User First Web Application to fit Your Needs.</div>
      </div>


    </div>
  );
}

export default App;
